import React from 'react';

const contactsPageStyle = {
  textAlign: 'center',
  padding: '50px',
};

const ContactsPage = () => {
  return (
    <div style={contactsPageStyle}>
      <h2>Contact Us</h2>
      <p>Email: example@example.com</p>
      <p>Phone: (123) 456-7890</p>
    </div>
  );
};

export default ContactsPage;
